💖🌱 3 Years officially being Vegan!!! 🌱🥳💕 I love that saying: “Do something your future self will thank you for”, and Going vegan , for me, was It!!! It is one of the best decisions I’ve made in my life, hands down 💕As it is for many people exploring living vegan and plant based, it was a process finding the best alternatives in the foods I loved and ate regularly( I thought I’d never “give up” cheese and ice cream and now there are epic cheese and ice cream alternatives that will blow your mind!!!) and  being open to new things too! When I was finally ready to fully commit I felt so good about it! It also came right before the start of the pandemic so I really learned to cook delicious vegan meals and develop a new relationship with food😜!! I still get so excited to try new recipes and am blown away how literally everything can be veganized!!! I truly love animals and i know choosing this way of life has definitely deepened my connection to my fur babies and all animals in general! 💕🌱🐕🐾🐣🐔🐷🐄 If you’re interested in integrating and moving towards a plant based diet too I’m going to list a few folks that I follow with incredible recipes that make going vegan seem easy breezy and so delicious and exciting! WHICH IT IS!!! And some food companies too! I recommend following them and picking up their cook book too for those of them that have them available! 💕🌱 ( list to follow;) And of course some fellow vegan companies like the creator of this awesome shirt @veganpowerco so you can also represent when you’re ready!!! 💕💋 I know this year I’m hoping to make more vegan friends and queer friends too! 🌱💕🥳🥳all in time!  I hope this inspires you! 
